import React from "react";
import { Paper, Button } from "@material-ui/core";
import { PriceTag, MonthTag } from "../../../pageframe/global/StyledComponents";

interface Props {
    offer: { price: number,
        durationMonth: number,
        features: string[] }
    onOfferClicked: (offer: any) => void
}

export const OfferView: React.FC<Props> = (props) => {

    const offer = props.offer;


   return (
    <Paper variant="outlined">

        <PriceTag color="primary">
            {offer.price}€/m
        </PriceTag>

        <MonthTag>
            Für {offer.durationMonth} Monate 
        </MonthTag>

        <ul>
            {offer.features.map((x) =>{
                return (
                    <li key={x}>{x}</li>
                )
            }
            )}
        </ul>
        <div style={{padding: '8px', width: '100%'}}>
            <Button variant="contained" color="secondary">loslegen</Button>
        </div>   
    </Paper>
   )
}
